INSERT INTO ` novedades` VALUES("7", "9c98ae22ba", "Tendencias de colores para paredes 2019 para tu casa", "<p>Esta de moda que los propietarios busquen asistencia de profesionales a la hora de mejorar su casa para ser vendida o rentada. A veces con unas pocas mejoras, el aspecto general cambia bastante y logra un impacto que se ver&aacute; inmediatamente reflejado en el precio de venta. Si est&aacute;s pensando en una renovaci&oacute;n peque&ntilde;a, una nueva capa de pintura sigue siendo una de las maneras m&aacute;s econ&oacute;micas para lograr un cambio. Te mostraremos algunos colores de pintura para paredes que ser&aacute;n tendencia en 2019.</p>INSERT INTO ` novedades` VALUES("8", "402c56640c", "Cómo pintar las paredes interiores", "<p>Pintar las paredes es una tarea sencilla que todos podemos llegar a hacer, y que cambia el aspecto de tu casa de forma notable. Espero que estos consejos te sirvan de ayuda.</p>INSERT INTO ` novedades` VALUES("9", "dd5105c332", "10 consejos para pintar paredes", "<p>Sea esta tu primera vez pintando una pared o la d&eacute;cima, estos consejos y trucos te ayudaran a que el terminado sea vea perfecto.</p>INSERT INTO ` pagos` VALUES("1", "Depósito bancario BANCO MACRO", "CUENTA BANCARIA", "1fa6940637", "0", "0", "10", "2", "0"); 
